import {Tableau2,Tableau3 } from '../components/Tableaimage';
import Cards from '../components/Cards';


function Men(){
    return(
        <>
        <Navbar/>
        
        div
        <div className='men'>
        <Product donnee={Tableau2}/>
        <div className='cardMen'>
        <Cards donnee={Tableau3}/>
        </div>
        </div>
        <div className='men'>
        <Product donnee={Tableau2}/>
        <div className='cardMen'>
        <Cards donnee={Tableau3}/>
        </div>
        </div>
       
       <Footer/>
        
        
        
        
        </>
    )
}
export default Men;
